import React from "react";
import { Button, DatePicker, version } from "antd";

const StyleView = () => {
  return (
    <>
      <h1>Css Testboard!</h1>
        <hr />
        <DatePicker />
        <Button type="primary" style={{ marginLeft: 8 }}>
            Primary Button
        </Button>
    </>
  );
};

export default StyleView;
